    def parse_grammar(grammar, input_string):

        stack = []
        result = {}
        for non_terminal in grammar:
            stack.append(non_terminal)

        for char in input_string:
            if char in grammar:
                if not stack:
                    return None
                top = stack.pop()
                if top in result:
                    return None
                result[top] = char
                stack.append(char)
        return result


